import React from 'react'
import TodoItem from "./TodoItem"

 function TodoList({todos, onComplete}) {
  return (
    <div>{
            todos.map((todo,i)=>(
                <TodoItem key={`todo-${i}`}todo={todo} onComplete = {onComplete} />
            ))}
            </div>
  )
}
export default TodoList
